const TableBody = (props) => {
  let x = props.elem.scores.sort((a, b) => {
    return a.s - b.s;
  });
  return (
    <tbody>
      {x.map((score, index) => (
        <tr className="border_bottom" key={index}>
          <td>{score.n}</td>
          <td>{score.s}</td>
        </tr>
      ))}
    </tbody>
  );
};
export default TableBody;
